import logo from './logo.svg';
import './App.css';
import NavBar from './components/NavBar';


function App() {
  return (
    <div className="App">
      <NavBar/> 



      <h1 className="mt-1 text-lg font-semibold text-white sm:text-slate-900 md:text-2xl dark:sm:text-white"> HOLA MUNDO!</h1>
      <h2> Vamos con el primer desafio, dejo lo de abajo porque esta muy bueno</h2>

    </div>
  );
}

export default App;
